source does not exist, or cannot be found. In some cases, the resource exists in a region other than the region specified in the API call.</p>', 'refs' => [], ], 'S3Key' => [ 'base' => NULL, 'refs' => [ 'S3Location$key' => '<p>Specifies the Amazon S3 key for the file location.</p>', 'SampleDocumentKeys$input' => '<p>An array of keys for your input sample documents.</p>', 'SampleDocumentKeys$output' => '<p>An array of keys for your output sample documents.</p>', ], ], 'S3Location' => [ 'base' => '<p>Specifies the details for the Amazon S3 file location that is being used with Amazon Web Services B2B Data Interchange. File locations in Amazon S3 are identified using a combination of the bucket and key.</p>', 'refs' => [ 'CreateStarterMappingTemplateRequest$outputSampleLocation' => '<p>Specify the location of the sample EDI file that is used to generate the mapping template.</p>', 'EdiConfiguration$inputLocation' => '<p>Contains the Amazon S3 bucket and prefix for the location of the input file, which is contained in an <code>S3Location</code> object.</p>', 'EdiConfiguration$outputLocation' => '<p>Contains the Amazon S3 bucket and prefix for the location of the output file, which is contained in an <code>S3Location</code> object.</p>', 'InstructionsDocuments$member' => NULL, 'OutputSampleFileSource$fileLocation' => NULL, 'S3LocationList$member' => NULL, 'StartTransformerJobRequest$inputFile' => '<p>Specifies the location of the input file for the transformation. The location consists of an Amazon S3 bucket and prefix.</p>', 'StartTransformerJobRequest$outputLocation' => '<p>Specifies the location of the output file for the transformation. The location consists of an Amazon S3 bucket and prefix.</p>', 'TestParsingRequest$inputFile' => '<p>Specifies an <code>S3Location</code> object, which contains the Amazon S3 bucket and prefix for the location of the input file.</p>', ], ], 'S3LocationList' => [ 'base' => NULL, 'refs' => [ 'GetTransformerJobResponse$outputFiles' => '<