> NULL, 'refs' => [], ], 'TagValue' => [ 'base' => NULL, 'refs' => [ 'Tag$Value' => '<p>Contains one or more values that you assigned to the key name that you create.</p>', ], ], 'TemplateDetails' => [ 'base' => '<p>A data structure that contains the information to use when generating a mapping template.</p>', 'refs' => [ 'CreateStarterMappingTemplateRequest$templateDetails' => '<p> Describes the details needed for generating the template. Specify the X12 transaction set and version for which the template is used: currently, we only support X12. </p>', ], ], 'TestConversionRequest' => [ 'base' => NULL, 'refs' => [], ], 'TestConversionResponse' => [ 'base' => NULL, 'refs' => [], ], 'TestMappingInputFileContent' => [ 'base' => NULL, 'refs' => [ 'TestMappingRequest$inputFileContent' => '<p>Specify the contents of the EDI (electronic data interchange) XML or JSON file that is used as input for the transform.</p>', ], ], 'TestMappingRequest' => [ 'base' => NULL, 'refs' => [], ], 'TestMappingResponse' => [ 'base' => NULL, 'refs' => [], ], 'TestParsingRequest' => [ 'base' => NULL, 'refs' => [], ], 'TestParsingResponse' => [ 'base' => NULL, 'refs' => [], ], 'ThrottlingException' => [ 'base' => '<p>The request was denied due to throttling: the data speed and rendering may be limited depending on various parameters and conditions.</p>', 'refs' => [], ], 'ToFormat' => [ 'base' => NULL, 'refs' => [ 'OutputConversion$toFormat' => '<p>The format for the output from an outbound transformer: only X12 is currently supported.</p>', ], ], 'TradingPartnerId' => [ 'base' => NULL, 'refs' => [ 'CreatePartnershipResponse$tradingPartnerId' => '<p>Returns the unique, system-generated identifier for a trading partner.</p>', 'GetPartnershipResponse$tradingPartnerId' => '<p>Returns the unique identifier for the partner for this partnership.</p>', 'PartnershipSummary$tradingPartnerId' => '<p>Returns the unique, system-generated identifier for a trading partner.</p>', 'UpdatePartnershipResponse$tradingPartnerId' => '<p>Returns the unique, system-generated identifier for a trading partner.</p>', ], ], 'TransformerId' => [ 'base' => NULL, 'refs' => [ 'CreateTransformerResponse$transformerId' => '<p>Returns the system-assigned unique identifier for the transformer.</p>', 'DeleteTransformerRequest$transformerId' => '<p>Specifies the system-assigned unique identifier for the transformer.</p>', 'EdiConfiguration$transformerId' => '<p>Returns the system-assigned unique identifier for the transformer.</p>', 'GetTransformerJobRequest$transformerId' => '<p>Specifies the system-assigned unique identifier for the transformer.</p>', 'GetTransformerRequest$transformerId' => '<p>Specifies the system-assigned unique identifier for the transformer.</p>', 'GetTransformerResponse$transformerId' => '<p>Returns the system-assigned unique identifier for the transformer.</p>', 'StartTransformerJobRequest$transformerId' => '<p>Specifies the system-assigned unique identifier for the transformer.</p>', 'TransformerSummary$transformerId' => '<p>Returns the system-assigned unique identifier for the transformer.</p>', 'UpdateTransformerRequest$transformerId' => '<p>Specifies the system-assigned unique identifier for the transformer.</p>', 'UpdateTransformerResponse$transformerId' => '<p>Returns the system-assigned unique identifier for the transformer.</p>', ], ], 'TransformerJobId' => [ 'base' => NULL, 'refs' => [ 'GetTransformerJobRequest$transformerJobId' => '<p>Specifies the unique, system-generated identifier for a transformer run.</p>', 'StartTransformerJobResponse$transformerJobId' => '<p>Returns the unique, system-generated identifier for a transformer run.</p>', ], ], 'TransformerJobStatus' => [ 'base' => NULL, 'refs' => [ 'GetTransformerJobResponse$status' => '<p>Returns the current state of the transformer job, either <code>running</code>, <code>succeeded</code>, or <code>failed</code>.</p>', ], ], 'TransformerList' => [ 'base' => NULL, 'refs' => [ 'ListTransformersResponse$transformers' => '<p>Returns an array of one or more transformer objects.</p> <p>For each transformer, a <code>TransformerSummary</code> object is returned. The <code>TransformerSummary</code> contains all the details for a specific transformer.</p>', ], ], 'TransformerName' => [ 'base' => NULL, 'refs' => [ 'CreateTransformerRequest$name' => '<p>Specifies the name of the transformer, used to identify it.</p>', 'CreateTransformerResponse$name' => '<p>Returns the name of the transformer, used to identify it.</p>', 'GetTransformerResponse$name' => '<p>Returns the name of the transformer, used to identify it.</p>', 'TransformerSummary$name' => '<p>Returns the descriptive name for the transformer.</p>', 'UpdateTransformerRequest$name' => '<p>Specify a new name for the transformer, if you want to update it.</p>', 'UpdateTransformerResponse$name' => '<p>Returns the name of the transformer.</p>', ], ], 'TransformerStatus' => [ 'base' => NULL, 'refs' => [ 'CreateTransformerResponse$status' => '<p>Returns the state of the newly created transformer. The transformer can be either <code>active</code> or <code>inactive</code>. For the transformer to be used in a capability, its status must <code>active</code>.</p>', 'GetTransformerResponse$status' => '<p>Returns the state of the newly created transformer. The transformer can be either <code>active</code> or <code>inactive</code>. For the transformer to be used in a capability, its status must <code>active</code>.</p>', 'TransformerSummary$status' => '<p>Returns the state of the newly created transformer. The transformer can be either <code>active</code> or <code>inactive</code>. For the transformer to be used in a capability, its status must <code>active</code>.</p>', 'UpdateTransformerRequest$status' => '<p>Specifies the transformer\'s status. You can update the state of the transformer from <code>inactive</code> to <code>active</code>.</p>', 'UpdateTransformerResponse$status' => '<p>Returns the state of the newly created transformer. The transformer can be either <code>active</code> or <code>inactive</code>. For the transformer to be used in a capability, its status must <code>active</code>.</p>', ], ], 'TransformerSummary' => [ 'base' => '<p>Contains the details for a transformer object. A transformer can take an EDI file as input and transform it into a JSON-or XML-formatted document. Alternatively, a transformer can take a JSON-or XML-formatted document as input and transform it into an EDI file.</p>', 'refs' => [ 'TransformerList$member' => NULL, ], ], 'UntagResourceRequest' => [ 'base' => NULL, 'refs' => [], ], 'UpdateCapabilityRequest' => [ 'base' => NULL, 'refs' => [], ], 'UpdateCapabilityResponse' => [ 'base' => NULL, 'refs' => [], ], 'UpdatePartnershipRequest' => [ 'base' => NULL, 'refs' => [], ], 'UpdatePartnershipResponse' => [ 'base' => NULL, 'refs' => [], ], 'UpdateProfileRequest' => [ 'base' => NULL, 'refs' => [], ], 'UpdateProfileResponse' => [ 'base' => NULL, 'refs' => [], ], 'UpdateTransformerRequest' => [ 'base' => NULL, 'refs' => [], ], 'UpdateTransformerResponse' => [ 'base' => NULL, 'refs' => [], ], 'ValidationException' => [ 'base' => '<p>Occurs when a B2BI object cannot be validated against a request from another object. This exception can be thrown during standard EDI validation or when custom validation rules fail, such as when element length constraints are violated, invalid codes are used in code list validations, or required elements are missing based on configured element requirement rules.</p>', 'refs' => [], ], 'ValidationMessages' => [ 'base' => NULL, 'refs' => [ 'TestConversionResponse$validationMessages' => '<p>Returns an array of validation messages that Amazon Web Services B2B Data Interchange generates during the conversion process. These messages include both standard EDI validation results and custom validation messages when custom validation rules are configured. Custom validation messages provide detailed feedback on element length constraints, code list validations, and element requirement checks applied during the outbound EDI generation process.</p>', 'TestParsingResponse$validationMessages' => '<p>Returns an array of validation messages generated during EDI validation. These messages provide detailed information about validation errors, warnings, or confirmations based on the configured X12 validation rules such as element length constraints, code list validations, and element requirement checks. This field is populated when the <code>TestParsing</code> API validates EDI documents.</p>', ], ], 'WrapFormat' => [ 'base' => NULL, 'refs' => [ 'WrapOptions$wrapBy' => '<p>Specifies the method used for wrapping lines in the EDI output. Valid values:</p> <ul> <li> <p> <code>SEGMENT</code>: Wraps by segment.</p> </li> <li> <p> <code>ONE_LINE</code>: Indicates that the entire content is on a single line.</p> <note> <p>When you specify <code>ONE_LINE</code>, do not provide either the line length nor the line terminator value.</p> </note> </li> <li> <p> <code>LINE_LENGTH</code>: Wraps by character count, as specified by <code>lineLength</code> value.</p> </li> </ul>', ], ], 'WrapOptions' => [ 'base' => '<p>Contains options for wrapping (line folding) in X12 EDI files. Wrapping controls how long lines are handled in the EDI output.</p>', 'refs' => [ 'X12Envelope$wrapOptions' => NULL, ], ], 'X12AcknowledgmentOptions' => [ 'base' => '<p>Contains options for configuring X12 acknowledgments. These options control how functional and technical acknowledgments are handled.</p>', 'refs' => [ 'X12InboundEdiOptions$acknowledgmentOptions' => '<p>Specifies acknowledgment options for inbound X12 EDI files. These options control how functional and technical acknowledgments are handled.</p>', ], ], 'X12AcknowledgmentRequestedCode' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$acknowledgmentRequestedCode' => '<p>Located at position ISA-14 in the header. The value "1" indicates that the sender is requesting an interchange acknowledgment at receipt of the interchange. The value "0" is used otherwise.</p>', ], ], 'X12AdvancedOptions' => [ 'base' => '<p>Contains advanced options specific to X12 EDI processing, such as splitting large X12 files into smaller units.</p>', 'refs' => [ 'AdvancedOptions$x12' => '<p>A structure that contains X12-specific advanced options, such as split options for processing X12 EDI files.</p>', ], ], 'X12ApplicationReceiverCode' => [ 'base' => NULL, 'refs' => [ 'X12FunctionalGroupHeaders$applicationReceiverCode' => '<p>A value representing the code used to identify the party receiving a message, at position GS-03.</p>', ], ], 'X12ApplicationSenderCode' => [ 'base' => NULL, 'refs' => [ 'X12FunctionalGroupHeaders$applicationSenderCode' => '<p>A value representing the code used to identify the party transmitting a message, at position GS-02.</p>', ], ], 'X12CodeListValidationRule' => [ 'base' => '<p>Defines a validation rule that modifies the allowed code values for a specific X12 element. This rule allows you to add or remove valid codes from an element\'s standard code list, providing flexibility to accommodate trading partner-specific requirements or industry variations. You can specify codes to add to expand the allowed values beyond the X12 standard, or codes to remove to restrict the allowed values for stricter validation.</p>', 'refs' => [ 'X12ValidationRule$codeListValidationRule' => '<p>Specifies a code list validation rule that modifies the allowed code values for a specific X12 element. This rule enables you to customize which codes are considered valid for an element, allowing for trading partner-specific code requirements.</p>', ], ], 'X12ComponentSeparator' => [ 'base' => NULL, 'refs' => [ 'X12Delimiters$componentSeparator' => '<p>The component, or sub-element, separator. The default value is <code>:</code> (colon).</p>', ], ], 'X12ControlNumbers' => [ 'base' => '<p>Contains configuration for X12 control numbers used in X12 EDI generation. Control numbers are used to uniquely identify interchanges, functional groups, and transaction sets.</p>', 'refs' => [ 'X12OutboundEdiHeaders$controlNumbers' => '<p>Specifies control number configuration for outbound X12 EDI headers. These settings determine the starting values for interchange, functional group, and transaction set control numbers.</p>', ], ], 'X12DataElementSeparator' => [ 'base' => NULL, 'refs' => [ 'X12Delimiters$dataElementSeparator' => '<p>The data element separator. The default value is <code>*</code> (asterisk).</p>', ], ], 'X12Delimiters' => [ 'base' => '<p>In X12 EDI messages, delimiters are used to mark the end of segments or elements, and are defined in the interchange control header. The delimiters are part of the message\'s syntax and divide up its different elements.</p>', 'refs' => [ 'X12OutboundEdiHeaders$delimiters' => '<p>The delimiters, for example semicolon (<code>;</code>), that separates sections of the headers for the X12 object.</p>', ], ], 'X12Details' => [ 'base' => '<p>A structure that contains the X12 transaction set and version. The X12 structure is used when the system transforms an EDI (electronic data interchange) file.</p> <note> <p>If an EDI input file contains more than one transaction, each transaction must have the same transaction set and version, for example 214/4010. If not, the transformer cannot parse the file.</p> </note>', 'refs' => [ 'ConversionTargetFormatDetails$x12' => NULL, 'EdiType$x12Details' => '<p>Returns the details for the EDI standard that is being used for the transformer. Currently, only X12 is supported. X12 is a set of standards and corresponding messages that define specific business documents.</p>', 'FormatOptions$x12' => NULL, 'TemplateDetails$x12' => NULL, ], ], 'X12ElementLengthValidationRule' => [ 'base' => '<p>Defines a validation rule that specifies custom length constraints for a specific X12 element. This rule allows you to override the standard minimum and maximum length requirements for an element, enabling validation of trading partner-specific length requirements that may differ from the X12 specification. Both minimum and maximum length values must be specified and must be between 1 and 200 characters.</p>', 'refs' => [ 'X12ValidationRule$elementLengthValidationRule' => '<p>Specifies an element length validation rule that defines custom length constraints for a specific X12 element. This rule allows you to enforce minimum and maximum length requirements that may differ from the standard X12 specification.</p>', ], ], 'X12ElementLengthValidationRuleMaxLengthInteger' => [ 'base' => NULL, 'refs' => [ 'X12ElementLengthValidationRule$maxLength' => '<p>Specifies the maximum allowed length for the identified element. This value must be between 1 and 200 characters and defines the upper limit for the element\'s content length.</p>', ], ], 'X12ElementLengthValidationRuleMinLengthInteger' => [ 'base' => NULL, 'refs' => [ 'X12ElementLengthValidationRule$minLength' => '<p>Specifies the minimum required length for the identified element. This value must be between 1 and 200 characters and defines the lower limit for the element\'s content length.</p>', ], ], 'X12ElementRequirementValidationRule' => [ 'base' => '<p>Defines a validation rule that modifies the requirement status of a specific X12 element within a segment. This rule allows you to make optional elements mandatory or mandatory elements optional, providing flexibility to accommodate different trading partner requirements and business rules. The rule targets a specific element position within a segment and sets its requirement status to either OPTIONAL or MANDATORY.</p>', 'refs' => [ 'X12ValidationRule$elementRequirementValidationRule' => '<p>Specifies an element requirement validation rule that modifies whether a specific X12 element is required or optional within a segment. This rule provides flexibility to accommodate different trading partner requirements for element presence.</p>', ], ], 'X12Envelope' => [ 'base' => '<p>A wrapper structure for an X12 definition object.</p> <p>the X12 envelope ensures the integrity of the data and the efficiency of the information exchange. The X12 message structure has hierarchical levels. From highest to the lowest, they are:</p> <ul> <li> <p>Interchange Envelope</p> </li> <li> <p>Functional Group</p> </li> <li> <p>Transaction Set</p> </li> </ul>', 'refs' => [ 'OutboundEdiOptions$x12' => '<p>A structure that contains an X12 envelope structure.</p>', ], ], 'X12FunctionalAcknowledgment' => [ 'base' => NULL, 'refs' => [ 'X12AcknowledgmentOptions$functionalAcknowledgment' => '<p>Specifies whether functional acknowledgments (997/999) should be generated for incoming X12 transactions. Valid values are <code>DO_NOT_GENERATE</code>, <code>GENERATE_ALL_SEGMENTS</code> and <code>GENERATE_WITHOUT_TRANSACTION_SET_RESPONSE_LOOP</code>.</p> <p>If you choose <code>GENERATE_WITHOUT_TRANSACTION_SET_RESPONSE_LOOP</code>, Amazon Web Services B2B Data Interchange skips the AK2_Loop when generating an acknowledgment document.</p>', ], ], 'X12FunctionalGroupHeaders' => [ 'base' => '<p>Part of the X12 message structure. These are the functional group headers for the X12 EDI object.</p>', 'refs' => [ 'X12OutboundEdiHeaders$functionalGroupHeaders' => '<p>The functional group headers for the X12 object.</p>', ], ], 'X12GS05TimeFormat' => [ 'base' => '<p>Specifies the time format in the GS05 element (time) of the functional group header. The following formats use 24-hour clock time:</p> <ul> <li> <p> <code>HHMM</code> - Hours and minutes</p> </li> <li> <p> <code>HHMMSS</code> - Hours, minutes, and seconds</p> </li> <li> <p> <code>HHMMSSDD</code> - Hours, minutes, seconds, and decimal seconds</p> </li> </ul> <p>Where:</p> <ul> <li> <p> <code>HH</code> - Hours (00-23)</p> </li> <li> <p> <code>MM</code> - Minutes (00-59)</p> </li> <li> <p> <code>SS</code> - Seconds (00-59)</p> </li> <li> <p> <code>DD</code> - Hundredths of seconds (00-99)</p> </li> </ul>', 'refs' => [ 'X12OutboundEdiHeaders$gs05TimeFormat' => NULL, ], ], 'X12IdQualifier' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$senderIdQualifier' => '<p>Located at position ISA-05 in the header. Qualifier for the sender ID. Together, the ID and qualifier uniquely identify the sending trading partner.</p>', 'X12InterchangeControlHeaders$receiverIdQualifier' => '<p>Located at position ISA-07 in the header. Qualifier for the receiver ID. Together, the ID and qualifier uniquely identify the receiving trading partner.</p>', ], ], 'X12InboundEdiOptions' => [ 'base' => '<p>Contains options specific to processing inbound X12 EDI files.</p>', 'refs' => [ 'InboundEdiOptions$x12' => '<p>A structure that contains X12-specific options for processing inbound X12 EDI files.</p>', ], ], 'X12InterchangeControlHeaders' => [ 'base' => '<p>In X12, the Interchange Control Header is the first segment of an EDI document and is part of the Interchange Envelope. It contains information about the sender and receiver, the date and time of transmission, and the X12 version being used. It also includes delivery information, such as the sender and receiver IDs.</p>', 'refs' => [ 'X12OutboundEdiHeaders$interchangeControlHeaders' => '<p>In X12 EDI messages, delimiters are used to mark the end of segments or elements, and are defined in the interchange control header.</p>', ], ], 'X12OutboundEdiHeaders' => [ 'base' => '<p>A structure containing the details for an outbound EDI object.</p>', 'refs' => [ 'X12Envelope$common' => '<p>A container for the X12 outbound EDI headers.</p>', ], ], 'X12ReceiverId' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$receiverId' => '<p>Located at position ISA-08 in the header. This value (along with the <code>receiverIdQualifier</code>) identifies the intended recipient of the interchange. </p>', ], ], 'X12RepetitionSeparator' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$repetitionSeparator' => '<p>Located at position ISA-11 in the header. This string makes it easier when you need to group similar adjacent element values together without using extra segments.</p> <note> <p>This parameter is only honored for version greater than 401 (<code>VERSION_4010</code> and higher).</p> <p>For versions less than 401, this field is called <a href="https://www.stedi.com/edi/x12-004010/segment/ISA#ISA-11">StandardsId</a>, in which case our service sets the value to <code>U</code>.</p> </note>', ], ], 'X12ResponsibleAgencyCode' => [ 'base' => NULL, 'refs' => [ 'X12FunctionalGroupHeaders$responsibleAgencyCode' => '<p>A code that identifies the issuer of the standard, at position GS-07.</p>', ], ], 'X12SegmentTerminator' => [ 'base' => NULL, 'refs' => [ 'X12Delimiters$segmentTerminator' => '<p>The segment terminator. The default value is <code>~</code> (tilde).</p>', ], ], 'X12SenderId' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$senderId' => '<p>Located at position ISA-06 in the header. This value (along with the <code>senderIdQualifier</code>) identifies the sender of the interchange. </p>', ], ], 'X12SplitBy' => [ 'base' => NULL, 'refs' => [ 'X12SplitOptions$splitBy' => '<p>Specifies the method used to split X12 EDI files. Valid values include <code>TRANSACTION</code> (split by individual transaction sets), or <code>NONE</code> (no splitting).</p>', ], ], 'X12SplitOptions' => [ 'base' => '<p>Contains options for splitting X12 EDI files into smaller units. This is useful for processing large EDI files more efficiently.</p>', 'refs' => [ 'X12AdvancedOptions$splitOptions' => '<p>Specifies options for splitting X12 EDI files. These options control how large X12 files are divided into smaller, more manageable units.</p>', ], ], 'X12TechnicalAcknowledgment' => [ 'base' => NULL, 'refs' => [ 'X12AcknowledgmentOptions$technicalAcknowledgment' => '<p>Specifies whether technical acknowledgments (TA1) should be generated for incoming X12 interchanges. Valid values are <code>DO_NOT_GENERATE</code> and <code>GENERATE_ALL_SEGMENTS</code> and.</p>', ], ], 'X12TransactionSet' => [ 'base' => NULL, 'refs' => [ 'X12Details$transactionSet' => '<p>Returns an enumerated type where each value identifies an X12 transaction set. Transaction sets are maintained by the X12 Accredited Standards Committee.</p>', ], ], 'X12UsageIndicatorCode' => [ 'base' => NULL, 'refs' => [ 'X12InterchangeControlHeaders$usageIndicatorCode' => '<p>Located at position ISA-15 in the header. Specifies how this interchange is being used:</p> <ul> <li> <p> <code>T</code> indicates this interchange is for testing.</p> </li> <li> <p> <code>P</code> indicates this interchange is for production.</p> </li> <li> <p> <code>I</code> indicates this interchange is informational.</p> </li> </ul>', ], ], 'X12ValidateEdi' => [ 'base' => NULL, 'refs' => [ 'X12OutboundEdiHeaders$validateEdi' => '<p>Specifies whether or not to validate the EDI for this X12 object: <code>TRUE</code> or <code>FALSE</code>. When enabled, this performs both standard EDI validation and applies any configured custom validation rules including element length constraints, code list validations, and element requirement checks. Validation results are returned in the response validation messages.</p>', ], ], 'X12ValidationOptions' => [ 'base' => '<p>Contains configuration options for X12 EDI validation. This structure allows you to specify custom validation rules that will be applied during EDI document processing, including element length constraints, code list modifications, and element requirement changes. These validation options provide flexibility to accommodate trading partner-specific requirements while maintaining EDI compliance. The validation rules are applied in addition to standard X12 validation to ensure documents meet both standard and custom requirements.</p>', 'refs' => [ 'X12AdvancedOptions$validationOptions' => '<p>Specifies validation options for X12 EDI processing. These options control how validation rules are applied during EDI document processing, including custom validation rules for element length constraints, code list validations, and element requirement checks.</p>', ], ], 'X12ValidationRule' => [ 'base' => '<p>Represents a single validation rule that can be applied during X12 EDI processing. This is a union type that can contain one of several specific validation rule types: code list validation rules for modifying allowed element codes, element length validation rules for enforcing custom length constraints, or element requirement validation rules for changing mandatory/optional status. Each validation rule targets specific aspects of EDI document validation to ensure compliance with trading partner requirements and business rules.</p>', 'refs' => [ 'X12ValidationRules$member' => NULL, ], ], 'X12ValidationRules' => [ 'base' => '<p>A list of X12 validation rules to be applied during EDI document processing. This collection allows you to specify multiple validation rules of different types that will be enforced when validating X12 EDI documents.</p>', 'refs' => [ 'X12ValidationOptions$validationRules' => '<p>Specifies a list of validation rules to apply during EDI document processing. These rules can include code list modifications, element length constraints, and element requirement changes.</p>', ], ], 'X12Version' => [ 'base' => NULL, 'refs' => [ 'X12Details$version' => '<p>Returns the version to use for the specified X12 transaction set.</p>', ], ], ],];
